package com.fashion.binge.fashiondesign.models;/** * Created by gokarna on 17/06/16. */public class OrderListModel {    private String orderId;    private String name;    private String orderStatus;    private String dateAdded;    private String products;    private String total;    public String getOrderId() {        return orderId;    }    public void setOrderId(String orderId) {        this.orderId = orderId;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getOrderStatus() {        return orderStatus;    }    public void setOrderStatus(String orderStatus) {        this.orderStatus = orderStatus;    }    public String getDateAdded() {        return dateAdded;    }    public void setDateAdded(String dateAdded) {        this.dateAdded = dateAdded;    }    public String getProducts() {        return products;    }    public void setProducts(String products) {        this.products = products;    }    public String getTotal() {        return total;    }    public void setTotal(String total) {        this.total = total;    }}